def html(link):
    Browser =  start_chrome(link, headless=True)
    browser_ = Browser.page_source
    soup = BeautifulSoup(browser_, "html.parser")
    return soup

def title_solprice(soup):
    products_list = []
    results = soup.find_all("div", {"class":"product-card__detail"})

    for item in results:
        products = {
            "title": item.find("h2", {"class": "product-card__title"}).text,
            "soldprice": item.find("div", {"class":"product-card__prices"}).text.replace("€", ""),
        }

        products_list.append(products)
    print(products_list)
    print(len(products_list))
    productsdf = pd.DataFrame(products_list)
    productsdf.to_csv_csv("carrefour_all_products.csv", mode="a", header=False)
    read_file = pd.read_csv("carrefour_all_products.csv")
    read_file.to_excel("carrefour_all_products.xlsx", index=None, header=True)

    return products_list


